(340, 1, 'ar', 'labels', 'backend.lessons.video_guide', '<p class = \"mb-1\"> <b> Youtube: </b> اذهب إلى Youtube -> اذهب إلى الفيديو الذي تريد عرضه -> انقر على زر المشاركة أسفل الفيديو. انسخ تلك الروابط والصقها في مربع النص أعلاه </p>\n<p class = \"mb-1\"> <b> Vimeo: </b> اذهب إلى Vimeo -> اذهب إلى الفيديو الذي تريد عرضه -> انقر على زر المشاركة وانسخ عنوان url للفيديو هنا </p>\n<p class = \"mb-1\"> <b> تحميل: </b> تحميل ملف <b> mp4 </b> في إدخال الملف </p>\n<p class = \"mb-1\"> <b> تضمين: </b> نسخ / لصق رمز التضمين في مربع النص أعلاه </p>', '2020-12-14 05:28:27', '2020-12-14 05:28:27'),
(341, 1, 'ar', 'labels', 'backend.lessons.view', 'عرض الدروس', '2020-12-14 05:28:27', '2020-12-14 05:28:27'),
(342, 1, 'ar', 'labels', 'backend.lessons.vimeo_note', '<b> تعليمات لإضافة رابط فيديو: </b> <br> انتقل إلى vimeo -> فيديو مفتوح -> انقر بزر الماوس الأيمن على الفيديو و <b> نسخ عنوان URL للفيديو </b> والصقه هنا. <br> لإضافة مقاطع فيديو متعددة ، قم بفصلها باستخدام علامة <b> و </b> (فاصلة).', '2020-12-14 05:28:27', '2020-12-14 05:28:27'),
(343, 1, 'ar', 'labels', 'backend.lessons.yt_note', '<b> تعليمات لإضافة رابط فيديو: </b> <br> انتقل إلى youtube -> open video -> انقر بزر الماوس الأيمن على الفيديو و <b> نسخ عنوان URL للفيديو </b> والصقه هنا. <br> لإضافة مقاطع فيديو متعددة ، قم بفصلها باستخدام علامة <b> و </b> (فاصلة).', '2020-12-14 05:28:27', '2020-12-14 05:28:27'),
