(489, 1, 'ar', 'labels', 'backend.general_settings.contact.map_note', '<ol class=\"map-guide\">\n<li>اذهب إلى <a class=\"text-bold\" target=\"_blank\" href=\"//maps.google.com\">خرائط جوجل</a> </li>\n<li>ابحث في المكان الذي تريد إضافته عن طريق إدخال العنوان / الموقع في مربع الإدخال الموجود في الركن الأيمن العلوي</li>\n<li>بمجرد الحصول على المكان الذي تريده. هذا يظهر التفاصيل في الشريط الجانبي الأيسر. انقر فوق <i class = \"fa fa-share-alt text-primary\"> زر </i></li>\n<li>ستظهر نافذة منبثقة تحتوي على علامتي تبويب <b> إرسال رابط </b> و <b> تضمين خريطة </b></li>\n<li>انقر فوق <b> تضمين خريطة </b> ستظهر لك اختيار \"مكان على الخريطة\"</li>\n<li>الآن انقر على القائمة المنسدلة من اليسار. بشكل افتراضي ، يتم تحديد <b> متوسط </b>. انقر عليها واختر <b> كبير </b></li>\n<li>الآن انقر على رابط <b class = \"text-primary\"> COPY HTML </b> منه و <b> لصق </b> هذا الرمز هنا في <b> الموقع على الخريطة </b>.</li>\n </ol>', '2020-12-14 05:28:27', '2020-12-14 05:28:27'),
