(770, 1, 'ar', 'labels', 'backend.translations.import_groups_note', '<p> سيؤدي هذا إلى الحصول على جميع ملفات الإعدادات المحلية من مجلد <code> lang </code> وإدراجها في قاعدة البيانات. <br> <b> إلحاق ترجمات جديدة: </b> سيُلحق فقط الملفات والبيانات الجديدة <b> & </b>\n                                             <b> استبدل الترجمات الحالية: </b> ستحل محل السجلات الحالية وفقًا للملفات </p>', '2020-12-14 05:28:28', '2020-12-14 05:28:28'),
