(784, 1, 'ar', 'labels', 'backend.update.note_before_upload', '<p> <b> يرجى أخذ BACKUP قبل التحديث. </b> قد يأتي ملف zip المحدث مع مجلدات جديدة وتحديثات للملفات. <b> سيتم استبدال ملفاتك الحالية بملف جديد </b>. لذا ، <b> إذا قمت بإجراء أي تغييرات في ملفات التطبيق الحالية ، فسيكون هذا المفقود </b>. </p>\n                         <p> إذا كنت تقوم بالتحميل مباشرة من مربع إدخال الملف أدناه ، فسيتم استبدال ملفاتك. نوصي بشدة بالقيام بذلك الاستبدال اليدوي للملفات واحدًا تلو الآخر أو تعديل التغييرات من خلال مقارنة الملف الذي تم تعديله الحالي والملفات الجديدة المحدثة. </p>\n                         <p> إذا كنت لا تزال تعاني من الارتباك. يرجى الاتصال بنا ، وسوف نوجهك لتحديث التطبيق الخاص بك </p>', '2020-12-14 05:28:28', '2020-12-14 05:28:28'),
(785, 1, 'ar', 'labels', 'backend.update.note_before_upload_title', 'قراءة الملاحظات التالية قبل التحديث', '2020-12-14 05:28:28', '2020-12-14 05:28:28'),
