(788, 1, 'ar', 'labels', 'backend.update.warning', '<b> تحذير: نوصيك بشدة بتحديث المظهر حسب رقم الإصدار </b>. <br> <b> مثال: </b> update_v1.zip، update_v2.zip. من فضلك لا تقفز رقم الإصدار. إذا كان رقم الإصدار هو 1 وتريد تحديثه ، فقم بالتحديث إلى الإصدار 2. لا تقم بالتحديث مباشرة إلى الإصدار 3.', '2020-12-14 05:28:28', '2020-12-14 05:28:28'),
