(4719, 1, 'es', 'labels', 'backend.lessons.vimeo_note', '<b> Instrucciones para agregar el enlace del video: </b> <br> Vaya a vimeo -> abrir video -> haga clic derecho en el video y <b> Copiar URL del video </b> y péguelo aquí. <br> Si desea para agregar varios videos, luego sepárelos con <b>, </b> (coma) Firmar.', '2020-12-14 05:28:49', '2020-12-14 05:28:49'),
(4720, 1, 'es', 'labels', 'backend.lessons.yt_note', '<b> Instructions pour ajouter un lien vidéo: </b> <br> Allez sur youtube -> ouvrir la vidéo -> faites un clic droit sur la vidéo et <b> Copier l\'URL de la vidéo </b> et collez-le ici. <br> Si vous voulez pour ajouter plusieurs vidéos, séparez-les par <b>, </b> (Virgule).', '2020-12-14 05:28:49', '2020-12-14 05:28:49'),
