(5143, 1, 'es', 'labels', 'backend.update.note_before_upload', '<p> <b> Realice BACKUP antes de actualizar. </b> El archivo zip actualizado puede incluir nuevas carpetas y actualizaciones de archivos. <b> Sus archivos actuales serán reemplazados por uno nuevo </b>. Por lo tanto, <b> si ha realizado algún cambio en los archivos de la aplicación actual, se PERDERÁ </b>. </p>\n                         <p> Si está cargando directamente desde el cuadro de entrada de archivo inferior, sus archivos serán reemplazados. Le recomendamos encarecidamente que realice la sustitución manual de los archivos uno por uno o edite los cambios comparando su archivo editado actual y los nuevos archivos actualizados. </p>\n                         <p> Si todavía tienes confusión. Póngase en contacto con nosotros, le guiaremos para actualizar su aplicación </p>', '2020-12-14 05:28:52', '2020-12-14 05:28:52'),
(5144, 1, 'es', 'labels', 'backend.update.note_before_upload_title', 'Lea las siguientes notas antes de actualizar', '2020-12-14 05:28:52', '2020-12-14 05:28:52'),
(5145, 1, 'es', 'labels', 'backend.update.title', 'Tema de actualización', '2020-12-14 05:28:52', '2020-12-14 05:28:52'),
(5146, 1, 'es', 'labels', 'backend.update.upload', 'Subir nueva versión <small> (update.zip) </small>', '2020-12-14 05:28:52', '2020-12-14 05:28:52'),
(5147, 1, 'es', 'labels', 'backend.update.warning', '<b> ADVERTENCIA: le recomendamos encarecidamente que actualice el tema por el número de versión </b>. <br> <b> Ejemplo: </b> update_v1.zip, update_v2.zip. Por favor, no saltar el número de versión. Si su número de versión es 1 y desea actualizarlo, entonces actualice a la versión 2. No actualice directamente a la versión 3.', '2020-12-14 05:28:52', '2020-12-14 05:28:52'),
