(6790, 1, 'fr', 'labels', 'backend.lessons.video_guide', '<p class = \"mb-1\"> <b> Youtube: </b> Allez sur Youtube -> Allez à la vidéo que vous souhaitez afficher -> cliquez sur le bouton Partager en dessous de la vidéo. Copiez ces liens et collez-les dans la zone de texte ci-dessus </p>\n<p class = \"mb-1\"> <b> Vimeo: </b> Aller à Vimeo -> Aller à la vidéo que vous souhaitez afficher -> cliquez sur le bouton Partager et copiez l\'URL de la vidéo de collage ici </p>\n<p class = \"mb-1\"> <b> Transférer: </b> Transférer un fichier <b> mp4 </b> dans l\'entrée de fichier </p>.\n<p class = \"mb-1\"> <b> Incorporer: </b> copier / coller le code intégré dans la zone de texte ci-dessus </p>', '2020-12-14 05:29:09', '2020-12-14 05:29:09'),
(6791, 1, 'fr', 'labels', 'backend.lessons.remove', 'Retirer', '2020-12-14 05:29:09', '2020-12-14 05:29:09'),
(6792, 1, 'fr', 'labels', 'backend.lessons.enter_video_embed_code', 'Entrez le code d\'intégration de la vidéo', '2020-12-14 05:29:09', '2020-12-14 05:29:09'),
(6793, 1, 'fr', 'labels', 'backend.lessons.enter_video_url', 'Entrer des données vidéo', '2020-12-14 05:29:09', '2020-12-14 05:29:09'),
(6794, 1, 'fr', 'labels', 'backend.lessons.vimeo_note', '<b> Instructions pour ajouter un lien vidéo: </b> <br> Allez à vimeo -> ouvrir la vidéo -> cliquez avec le bouton droit sur la vidéo et <b> Copier l\'URL de la vidéo </b> et collez-le ici. <br> Si vous le souhaitez pour ajouter plusieurs vidéos, séparez-les par <b>, </b> (Virgule).', '2020-12-14 05:29:09', '2020-12-14 05:29:09'),
(6795, 1, 'fr', 'labels', 'backend.lessons.yt_note', '<b> Instructions pour ajouter un lien vidéo: </b> <br> Allez sur youtube -> ouvrir la vidéo -> faites un clic droit sur la vidéo et <b> Copier l\'URL de la vidéo </b> et collez-le ici. <br> Si vous voulez pour ajouter plusieurs vidéos, séparez-les par <b>, </b> (Virgule).', '2020-12-14 05:29:09', '2020-12-14 05:29:09'),
