(7218, 1, 'fr', 'labels', 'backend.update.note_before_upload', '<p> <b> Veuillez effectuer une sauvegarde avant la mise à jour. </b> Un fichier zip mis à jour peut être fourni avec de nouveaux dossiers et mises à jour de fichiers. <b> Vos fichiers actuels seront remplacés par de nouveaux </b>. Ainsi, <b> si vous avez apporté des modifications aux fichiers de l\'application en cours, ce sera PERDU </b>. </p>\n                         <p> Si vous téléchargez directement depuis la zone de saisie de fichier ci-dessous, vos fichiers seront remplacés. Nous vous recommandons vivement de procéder au remplacement manuel des fichiers un par un ou de modifier les modifications en comparant votre fichier modifié actuel et les nouveaux fichiers mis à jour. </p>\n                         <p> Si vous avez encore de la confusion. S\'il vous plaît contactez-nous, nous vous guiderons pour mettre à jour votre application </p>', '2020-12-14 05:29:13', '2020-12-14 05:29:13'),
(7219, 1, 'fr', 'labels', 'backend.update.note_before_upload_title', 'Lire les notes suivantes avant la mise à jour', '2020-12-14 05:29:13', '2020-12-14 05:29:13'),
